import React from 'react'
import { App } from "./src/App.js";
const Table = ({ companies }) => {
    return (
      <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Name</th>
            <th>url</th>
          </tr>
        </thead>
        <tbody>
          { (App.length > 0) ? App.map( (company, index) => {
             return (
              <tr key={ index }>
                <td>{ company._id }</td>
                <td>{ company.name }</td>
                <td>{ company.homepage_url}</td>
              </tr>
            )
           }) : <tr><td colSpan="5">Loading...</td></tr> }
        </tbody>
      </table>
    );
  }
export default Table;
